import React from 'react';
import styles from './Navbar.module.css';

function Navbar(){
    return(
        <nav>
           <a href="#home" className={styles.logo}><img src="../img/logo.svg" alt="logo"/></a> 
           <a href="#portfolio">Portfolio</a>
           <a href="#contact">Contact</a>
        </nav>
    );
}

export default Navbar;
